import React from 'react'
import { NavLink } from 'react-router-dom'

const Navbar = () => {
    return (
        <>
        <div className="container b ">

            <NavLink exact to="/" className="px-3 text-decoration-none" >Home</NavLink>
            <NavLink exact to="/about"className="px-3 text-decoration-none">About</NavLink>
        </div>
        </>
    )
}

export default Navbar
